    // Remove the XML declaration from the HTML text
    size_t start = htmlText.str().find_first_not_of("\n\r\x20\t");
    if (start!= std::string::npos) {
        size_t end = htmlText.str().find_first_of("\n\r\x20\t", start);
        if (end!= std::string::npos) {
            htmlText.str(htmlText.str().substr(start, end - start));
        } else {
            htmlText.str(htmlText.str().substr(start));
        }
    }

