In TypeScript, you can use a technique called "type narrowing" to convey to the type system that you know a value will have only one of the possible types, even if the type itself is a union of multiple types. However, there isn't a built-in way to directly tell the type system this.

One approach is to use the `in` operator to check the value and then use the resulting type. Here is an example:

```typescript
type Color = "red" | "green" | "blue";

function getRGB(color: Color): [number, number, number] | null {
  if (color === "red") {
    return [255, 0, 0]; // or some other value that's known to be red
  } else if (color === "green") {
    return [0, 255, 0]; // or some other value that's known to be green
  } else {
    return null; // or some other value that's known to be blue
  }
}

// Now the return type of `getRGB` is inferred to be [number, number, number] | null
const result1 = getRGB("red"); // [number, number, number]
const result2 = getRGB("green"); // [number, number, number]
const result3 = getRGB("blue"); // [number, number, number]
const result4 = getRGB("invalid"); // null
```

However, this approach can quickly become verbose and hard to read when dealing with complex types.

Another approach is to use a type guard. A type guard is a function that returns the type, which tells the TypeScript type system that the input is of a certain type. However, this requires you to use a type guard function, which can make the code a bit more complex.

Here's an example:

```typescript
type Color = "red" | "green" | "blue";

function isRed(color: Color): color is "red" {
  return color === "red";
}

function getRGB(color: Color): [number, number, number] {
  if (isRed(color)) {
    return [255, 0, 0]; // or some other value that's known to be red
  } else if (/* some other condition */) {
    return [/* some other value */];
  }
}

// Now the return type of `getRGB` is [number, number, number]
const result = getRGB("red"); // [number, number, number]
```

In this example, the `isRed` function is a type guard that tells the type system that if `isRed(color)` returns true, then `color` is known to be `"red"`. This allows the type of `color` to be narrowed to `"red"` inside the `if` block, and the type of `getRGB(color)` to be inferred to be `[number, number, number]`.

You can also use enums to narrow the type:

```typescript
enum Color {
  Red,
  Green,
  Blue,
}

function getRGB(color: Color): [number, number, number] {
  switch (color) {
    case Color.Red:
      return [255, 0, 0];
    case Color.Green:
      return [0, 255, 0];
    case Color.Blue:
      return [0, 0, 255];
  }
}

// Now the return type of `getRGB` is [number, number, number]
const result = getRGB(Color.Red); // [number, number, number]
```

This approach can be more concise and readable than the previous examples, and it's a good fit when dealing with enums.

