void findCommonElements(int arr1[], int arr2[], int n, int m) {
    int i, j;
    for (i = 0; i < n; i++) {
        for (j = 0; j < m; j++) {
            if (arr1[i] == arr2[j]) {
                printf("%d ", arr1[i]);
            }
        }
    }
}

// Driver code
int main() {
    int arr1[] = {1, 2, 3, 4, 5, 6};
    int arr2[] = {4, 5, 6, 7, 8, 9};
    int n = sizeof(arr1) / sizeof(arr1[0]);
    int m = sizeof(arr2) / sizeof(arr2[0]);

    printf("Array 1: ");
    for (int i = 0; i < n; i++) {
        printf("%d ", arr1[i]);
    }
    printf("\n");

    printf("Array 2: ");
    for (int i = 0; i < m; i++) {
        printf("%d ", arr2[i]);
    }
    printf("\n");

    printf("Common Elements: ");
    findCommonElements(arr1, arr2, n, m);
    printf("\n");

    return 0;
}
```

**How it Works**
-----------------

1.  The `findCommonElements` function takes two arrays, `arr1` and `arr2`, along with their sizes, `n` and `m`.
2.  It uses nested loops to iterate through both arrays.
3.  If an element from `arr1` matches an element from `arr2`, it is printed as a common element.
4.  In the `main` function, the program defines two sample arrays `arr1` and `arr2`, and their sizes `n` and `m`.
5.  It then calls the `findCommonElements` function to find and print the common elements.

